import ModelData from './CatalogViewer.json';

function CatalogViewer(){
    return(
        <main>
            <nav>
                {ModelData.map(item =>(
                    <li>
                        {console.log("\""+item.url+"\"")}
                        <div>                            
                            <img alt=""/>
                            <p>{item.rate}</p>
                        </div>
                        <div>
                            <p>{item.user}</p>
                            <p>{item.price}</p>
                        </div>
                    </li>
                ))}
            </nav>

        </main>
    );
}

export default CatalogViewer;
